import javafx.application.Application;
import javafx.scene.Scene;
import javafx.scene.image.Image;
import javafx.scene.image.ImageView;
import javafx.scene.layout.GridPane;
import javafx.stage.Stage;

public class M5P1 extends Application {

    @Override
    public void start(Stage primaryStage) {
        // Create a GridPane with 10px spacing
        GridPane grid = new GridPane();
        grid.setHgap(10);
        grid.setVgap(10);

        // Load images
        Image img1 = new Image("data:image/jpeg;base64,");
        Image img2 = new Image("data:image/jpeg;base64,");
        Image img3 = new Image("data:image/jpeg;base64,");
        Image img4 = new Image("data:image/jpeg;base64,");

        // Create ImageViews
        ImageView iv1 = new ImageView(img1);
        ImageView iv2 = new ImageView(img2);
        ImageView iv3 = new ImageView(img3);
        ImageView iv4 = new ImageView(img4);

        // Optionally, resize images
        iv1.setFitWidth(100); iv1.setFitHeight(100);
        iv2.setFitWidth(100); iv2.setFitHeight(100);
        iv3.setFitWidth(100); iv3.setFitHeight(100);
        iv4.setFitWidth(100); iv4.setFitHeight(100);

        // Add images to grid (row, column)
        grid.add(iv1, 0, 0);
        grid.add(iv2, 1, 0);
        grid.add(iv3, 0, 1);
        grid.add(iv4, 1, 1);

        // Create a scene and place it on the stage
        Scene scene = new Scene(grid, 500, 500);
        primaryStage.setTitle("4-Image Grid");
        primaryStage.setScene(scene);
        primaryStage.show();
    }

    public static void main(String[] args) {
        launch(args);
    }
}
